    console.log(data);
    return (
        <div>
            <table border={1}>
                <thead>
                    <tr>
                        <th>id</th>
                        <th>Title</th>
                        <th>Body</th>
                        <th>Action</th>
                    </tr>
                </thead>
                {!data ? <></> : <tbody>
                    {data.map((item , index) => {
                        return <tr key={index} >
                            <td>{item.id}</td>
                            <td style={{width:'300px'}}>{item.title}</td>
                            <td style={{width:'600px'}}>{item.body}</td>
                            <td >
                                <button onClick={()=>{Showdata(item.id)}} >more-info</button>
                            </td>
                        </tr>
                    })}
                </tbody>}
    
            </table>
        </div>
    )
}
export default Posts
